import React from 'react';
import{
  Container,
  Breadcrumb,
  Row,
  Col,
  Button,
  Badge
} from "react-bootstrap";

function App(){
  return(
    <Container>
    <Row>
      <Col>
        <Breadcrumb>
          <Breadcrumb.Item href="https://react-bootstrap.github.io">
            <h6>Website React Bootstrap</h6>
          </Breadcrumb.Item>
        </Breadcrumb>
      </Col>
      <Col xs={6}></Col>
      <Col>
        <Button variant="primary">
          Notifications <Badge variant="light">9</Badge>
        </Button>
      </Col>
    </Row>

    </Container>
  );
}

export default App;
